import React from 'react';
import styled from 'styled-components';
import SummonerSearchContainer from '../components/SummonerSearch/SummonerSearchContainer';
import SummonerSearchInput from '../components/SummonerSearch/SummonerSearchInput';

const Logo = styled.h1`
  color: #fff;
  margin: 0;
  font-family: 'Do Hyeon';
  font-size: 50px;
  letter-spacing: 2px;
  span {
    color: #06a6ff;
  }
`;

const Header = styled.nav`
  width: 100%;
  background-color: #0c0a26;
  height: 100px;
  display: flex;
  align-items: center;
  padding: 0px 30px;
`;

export default function Index() {
  return (
    <>
      <Header>
        <Logo>
          Rotzz.<span>gg</span>
        </Logo>
      </Header>
      <SummonerSearchContainer>
        <h1
          style={{
            margin: 0,
            color: `#fff`,
            fontFamily: 'Montserrat',
            fontSize: '48px',
            marginBottom: `35px`,
          }}
        >
          Take your gameplay to the next level
        </h1>
        <h2
          style={{
            margin: 0,
            color: `#fff`,
            fontFamily: 'Montserrat',
            fontSize: `24px`,
            fontWeight: 500,
          }}
        >
          <b style={{ color: `#FF9B00` }}>Build like a pro.</b> See how the pros
          are playing the game
        </h2>
        <SummonerSearchInput />
      </SummonerSearchContainer>
    </>
  );
}
